create table t_real_task
(
    id                    BIGINT(19) auto_increment
        primary key,
    task_name             VARCHAR(255)         null comment '任务名称',
    task_temp_id          BIGINT(19)           null comment '任务模板ID',
    yyyymmdd              VARCHAR(255)         null comment '任务生成的日期',
    status                VARCHAR(10)          null comment '任务完成状态',
    begin_time            BIGINT(19)           null comment '任务开启时间',
    over_time             BIGINT(19)           null comment '任务结束时间',
    sys_patrol_start_time VARCHAR(255)         null comment '系统巡更开始时间',
    sys_patrol_end_time   VARCHAR(255)         null comment '系统巡更结束时间',
    path                  VARCHAR(255)         null comment '巡更轨迹',
    start_up              VARCHAR(10)          null comment '是否启动（0:启动，1：关闭）',
    patrolman_id          BIGINT(19)           null comment '巡更人员id',
    patrolman             VARCHAR(255)         null comment '巡更人员名称',
    phone                 VARCHAR(255)         null comment '巡更人员电话',
    dept_id               BIGINT(19)           null,
    remark                VARCHAR(255)         null comment '描述',
    lock_barcode          VARCHAR(255)         null comment '车锁编号',
    is_approval           VARCHAR(255)         null comment '是否审核',
    create_time           BIGINT(19)           null comment '创建时间',
    instance_id           BIGINT(19) default 0 null comment '实例id'
)
    charset = utf8mb4;

